import React from 'react';
import { Link } from 'react-router-dom';
import { FaGamepad, FaBars, FaSignInAlt } from 'react-icons/fa';

const NewNavbar = () => {
  return (
    <nav className="bg-gradient-to-r from-[#111827] to-[#374151] shadow-md fixed w-full z-50">
      <div className="max-w-screen-xl mx-auto px-6 py-4 flex justify-between items-center">
        {/* Logo and Brand */}
        <div className="flex items-center space-x-4">
          <FaGamepad className="text-4xl text-white" />
          <span className="text-3xl font-bold text-white uppercase tracking-widest">GaminGo</span>
        </div>

        {/* Desktop Menu */}
        <div className="hidden md:flex items-center space-x-8 text-lg font-medium">
          <Link to="/" className="text-white hover:text-[#4ADE80] transition-all duration-300">Home</Link>
          <Link to="/about" className="text-white hover:text-[#4ADE80] transition-all duration-300">About</Link>
          <Link to="/contact" className="text-white hover:text-[#4ADE80] transition-all duration-300">Contact</Link>
          <Link to="/login" className="text-white hover:text-[#4ADE80] transition-all duration-300">Login</Link>
        </div>

        {/* Mobile Menu Button */}
        <div className="md:hidden flex items-center">
          <button className="text-white">
            <FaBars className="text-2xl" />
          </button>
        </div>
      </div>
    </nav>
  );
};

export default NewNavbar;
